import React, { Component } from "react";

class NavBar extends Component {
	render() {
		return (
			<div>
				{this.props.counters.length}
				<nav className='navbar navbar-light bg-light'>
					<a className='navbar-brand' href='#'>
						Navbar
					</a>
				</nav>
			</div>
		);
	}
}

export default NavBar;
